import axios from 'axios';
import React from 'react';
import { useState, useEffect } from 'react';

export default function Mainpage() {
  const [token, settoken] = useState('');
  const headers = {
    token,
  };
  useEffect(() => {
    axios
      .post(
        'http://localhost:8000/getallusers',
        { data: 'data' },
        { headers: headers }
      )
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return <div>hrl</div>;
}
